PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?associatedArtist ?bandOfMember ?realNameBand WHERE {
  # Nicholas Michael Curran's associated musical artist
  ?person rdfs:label "Nicholas Michael Curran"@en .
  ?person dbo:occupation dbr:Musical_artist .
  ?person dbo:associatedBandOrMusicalArtist ?associatedArtist .

  OPTIONAL {
    # Eric Clapton's band member and their band
    ?claptonMember dbo:memberOfBand dbr:Eric_Clapton .
    ?claptonMember dbo:memberOf ?bandOfMember .
  }

  OPTIONAL {
    # Kim Wilson's band real name
    ?kimWilson dbo:associatedBandOrMusicalArtist ?band .
    ?band rdfs:label ?realNameBand .
  }
}
```

