```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?commander WHERE {
  # Find wars that are both television shows and societal events
  ?war a dbo:War ;
      dbo:genre dbr:Television_show ;
      dbo:social_event true .

  # Jean Baptiste Comte d'Arco's involvement in the war
  ?dArco dbo:commanderIn ?war .
  dbr:Jean_Baptiste_Comte_d'_Arco ?dArco .

  # Find his commander who is also a politician and an office holder
  ?commander dbo:commanderIn ?war ;
            a dbo:Politician, dbo:OfficeHolder .

  # Check if this commander was succeeded by someone in the Russo-Polish War
  OPTIONAL {
    ?successor dbo:succeededBy ?commander .
    ?successor dbo:commanderIn dbr:Russo-Polish_War_(1654–1667) .
  }
}
```

