```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?reference ?associatedArtist WHERE {
  # Find The Fabulous Thunderbirds reference
  dbr:The_Fabulous_Thunderbirds dbo:bandMember ?member .

  # Find Nicholas Michael Curran's associated artist and band
  OPTIONAL { 
    ?curran a dbo:MusicalArtist ;
            foaf:name "Nicholas Michael Curran" ;
            dbo:associatedBand ?band .

    # Check if the band is The Fabulous Thunderbirds
    FILTER(?band = dbr:The_Fabulous_Thunderbirds)

    # Find Kim Wilson's associated artist and band
    OPTIONAL {
      ?kim a dbo:MusicalArtist ;
           foaf:name "Kim Wilson" ;
           dbo:associatedBand ?band .

      # Check if the band is The Fabulous Thunderbirds
      FILTER(?band = dbr:The_Fabulous_Thunderbirds)

      # Find associated artist of Nicholas Michael Curran
      ?curran dbo:associatedArtist ?associatedArtist .
    }
  }

  # Get reference to The Fabulous Thunderbirds
  OPTIONAL { 
    ?reference a dbo:Band ;
               foaf:name "The Fabulous Thunderbirds" .
  }
}
```

