  ?event dbo:type dbr:Military_conflict ;
         dbo:participatedIn ?militaryForce .
  ?societalEvent dbo:type dbr:Societal_event ;
                 dbo:relatedTo ?militaryForce .

  # Find the award related to William Bayne
  ?award dbo:recipient ?bayne ;
         rdf:type dbr:Knight_Commander_of_the_Order_of_the_Bath .

  # Ensure military force is associated with a war (military conflict)
  ?war dbo:type dbr:Military_conflict ;
       dbo:militaryForce ?militaryForce .

  # William Bayne's role in the French campaign
  ?campaign dbo:commander ?bayne ;
            rdf:type dbr:French_campaign_in_Egypt_and_Syria .
}
