  # Ensure the grandparent is royalty
  ?grandparent a dbo:Monarch ;
               dbo:spouse ?stephenVSpouse ;
               dbo:parent ?childParent .

  # Step 3: Find the father of this grandparent and his spouse (royalty)
  ?fatherOfGrandparent dbo:parent ?grandparent .

