PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?spouse WHERE {
  # Find books authored by Hillary Clinton
  ?book dbo:author dbr:Hillary_Clinton .

  # Ensure the book is a written work and a book
  ?book rdf:type dbo:Book ;
        rdf:type dbo:WrittenWork .

  # Find her spouse who is also an office holder and politician
  OPTIONAL {
    ?spouse dbo:spouse dbr:Hillary_Clinton ;
            dbo:officeHolder ?office .
    FILTER EXISTS { ?office dbo:positionTitle ?title }
    FILTER EXISTS { ?spouse rdf:type dbo:Politician }
  }

  # Metaphorical link to a commander in a war (disease or societal event)
  OPTIONAL {
    ?event dbo:commander ?spouse ;
           rdf:type dbo:Disease ;
           dbo:relatedTo dbr:United_States_Navy .
    UNION
    ?event dbo:commander ?spouse ;
           rdf:type dbo:SocietalEvent ;
           dbo:relatedTo dbr:United_States_Navy .
  }
}
```

